DROP TABLE IF EXISTS `integrated_data_table`;
CREATE TABLE `integrated_data_table` (
  `id` bigint(20) NOT NULL COMMENT '用户 id（主键，关联 sys_user 表的 user_id）',
  `name` varchar(300) DEFAULT NULL COMMENT '姓名',
  `weight` decimal(5,2) NOT NULL COMMENT '体重',
  `height` decimal(5,2) NOT NULL COMMENT '身高',
  `gender` varchar(2) NOT NULL COMMENT '性别',
  `age` bigint(20) NOT NULL COMMENT '年龄',
  `smoking` varchar(2) NOT NULL COMMENT '是否抽烟',
  `temp` decimal(5,2) NOT NULL COMMENT '体温',
  `temp_cut` decimal(5,2) NOT NULL COMMENT '膝盖温度',
  `pulse` bigint(20) NOT NULL COMMENT '脉搏',
  `sbp` bigint(20) NOT NULL COMMENT '收缩压',
  `dbp` bigint(20) NOT NULL COMMENT '舒张压',
  `swelling` varchar(5) NOT NULL COMMENT '是否肿胀',
  `knee` bigint(20) NOT NULL COMMENT '屈膝度',
  `step` bigint(20) NOT NULL COMMENT '行走步数',
  `pain` bigint(20) NOT NULL COMMENT '疼痛度',
  `decri` varchar(300) NOT NULL COMMENT '症状描述',
  `predict_result` bigint(20) DEFAULT NULL COMMENT '预测等级结果',
  `doctor_result` bigint(20) DEFAULT NULL COMMENT '医生反馈等级结果',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  CONSTRAINT `fk_integrated_data_table_id` FOREIGN KEY (`id`) REFERENCES `sys_user` (`user_id`)
